import React from 'react'

const oneOfList = ({thumbnail}) => (
        <li className="background-style">
                        <div className="w-30">
                            <img className=" thumbnail-style" src={thumbnail} alt="media" />
                        </div>
        </li>
)
const List = () => {
    const newsList = ['thumbnail']
    return (
        <ol>
            {newsList.map( (oneOfList , index)=>(
                <oneOfList key={index} name={oneOfList} />
            ) )}

        </ol>
    )
}
export default List
